import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonPage,

} from '@ionic/react';
import React from 'react';
import {entries} from '../data';


const HomePage: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Home</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
      {entries}
      </IonContent>
      </IonPage>
  );
};

export default HomePage;
